DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `Code` varchar(20) DEFAULT NULL COMMENT '编码',
  `Name` varchar(50) DEFAULT NULL COMMENT '商品名',
  `ShowName` varchar(500) DEFAULT NULL COMMENT '显示名称',
  `SellingPoint` varchar(100) DEFAULT NULL COMMENT '卖点',
  `CategoryId` varchar(18) DEFAULT NULL COMMENT '分类Id',
  `BrandId` int(11) DEFAULT NULL COMMENT '品牌Id',
  `InputRate` decimal(10,0) DEFAULT NULL COMMENT '进项税率',
  `OutRate` decimal(10,0) DEFAULT NULL COMMENT '销项税率',
  `IsGift` tinyint(1) DEFAULT NULL COMMENT '是否赠品',
  `Length` decimal(10,0) DEFAULT NULL COMMENT '长',
  `Width` decimal(10,0) DEFAULT NULL COMMENT '宽',
  `Height` decimal(10,0) DEFAULT NULL COMMENT '高',
  `Weight` decimal(10,0) DEFAULT NULL COMMENT '重量',
  `Unit` varchar(10) DEFAULT NULL COMMENT '单位',
  `Description` text COMMENT '详情描述',
  `Keywords` varchar(200) DEFAULT NULL COMMENT '关键字',
  `IsPublish` tinyint(1) DEFAULT NULL COMMENT '是否上架',
  `BarCode` varchar(50) DEFAULT NULL COMMENT '条码',
  `Specification` varchar(200) DEFAULT NULL COMMENT '规格名',
  `OldPrice` decimal(8,2) DEFAULT NULL COMMENT '原价',
  `SalePrice` decimal(8,2) DEFAULT NULL COMMENT '销售价',
  `WholeSalePrice` decimal(8,2) DEFAULT NULL COMMENT '批发价',
  `CostPrice` decimal(8,2) DEFAULT NULL COMMENT '平均成本价',
  `SubSkuCode` varchar(20) DEFAULT NULL COMMENT '子SKU代码',
  `SubSkuQuantity` int(11) DEFAULT NULL COMMENT '子SKU数量',
  `SpecificationQuantity` varchar(100) DEFAULT NULL COMMENT '件规, 多个逗号分隔',
  `CreatedOn` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `idx_product_code` (`Code`)
) ENGINE=InnoDB AUTO_INCREMENT=5386 DEFAULT CHARSET=utf8 COMMENT='商品';

